import Vue from 'vue';
import Router from 'vue-router';


import ShellGlobal from './views/ShellGlobalModule/ShellGlobalCode/ShellGlobal'
import Test from './views/ShellGlobalModule/ShellGlobalCode/Test'

import FileUpload from './views/FileManagerModule/Code/FileUploadManager'
import PushAbnormal from './views/FileManagerModule/Code/PushAbnormalFile'
import ProduceFileUpload from './views/FileManagerModule/Code/ProduceFileUpload'
import LogisticsUpload from './views/FileManagerModule/Code/LogisticsFileUpload'
import PushOEMFileList from './views/FileManagerModule/Code/PushOEMFileList'
import FileDownloadManager from './views/FileManagerModule/Code/FileDownloadManager.vue'
import InterfaceSystemLog from './views/FileManagerModule/Code/InterfaceSystemLog.vue'
import New from './views/NewModule/ShellGlobalCode/New.vue'

import UploadView from './views/ShellGlobalModule/ShellGlobalCode/UploadView.vue'


Vue.use(Router);

var router = new Router({
  mode: 'hash',
  routes: [
    {
      path: "/upload",
      name: "UploadView",
      meta: { title: "上传测试视图" },
      component: UploadView
    },
    {
      path: "/new",
      name: "New",
      meta: { title: "新建模块" },
      component: New
    },
    {
      path: "/test",
      name: "test",
      meta: { title: "测试控件" },
      component: Test
    },
    {
      path: "/shell-global",
      name: "ShellGlobal",
      meta: { title: "凭据统计报表" },
      component: ShellGlobal
    },
    {
      path: "/file-upload",
      name: "FileUpload",
      meta: { title: "文件上传管理" },
      component: FileUpload
    },
    {
      path: "/push-abnormal",
      name: "PushAbnormal",
      meta: { title: "推送异常文件列表" },
      component: PushAbnormal
    },
    {
      path: "/produce-upload",
      name: "ProduceFileUpload",
      meta: { title: "生产文件上传文件日志" },
      component: ProduceFileUpload
    },
    {
      path: "/logistics-upload",
      name: "LogisticsUpload",
      meta: { title: "物流文件上传文件日志" },
      component: LogisticsUpload
    },
    {
      path: "/push-record",
      name: "PushOEMFileList",
      meta: { title: "推送文件记录" },
      component: PushOEMFileList
    },
    {
      path: "/file-download",
      name: "FileDownloadManager",
      meta: { title: "文件下载记录" },
      component: FileDownloadManager
    },
    {
      path: "/interface-log",
      name: "InterfaceSystemLog",
      meta: { title: "接口系统日志" },
      component: InterfaceSystemLog
    }
  ],
});;
router.beforeEach((to, from, next) => {
  /* 路由发生变化修改页面title */
  if (to.meta.title) {
    document.title = to.meta.title
  }
  next();
})

export default router
